  return (
    <div style={{display:'flex',justifyContent:'center',border:''}}>
    <div className='pa5 dib shadow-2'>
      <h1>IMAGE DETECTION</h1>
      <Logo />
      <Searchbar />
    </div>
    </div>
  );
}

export default App;
